import React from 'react';
import styles from './Profile.module.css';
const Profile = (props) => {
  let image = [
    'https://sebweo.com/wp-content/uploads/2019/06/landshaft-bernskikh-alp-v-yasniy-den_thumb.jpg',
    'https://sebweo.com/wp-content/uploads/2019/06/landshaft-bernskikh-alp-v-yasniy-den_thumb.jpg',
    'https://sebweo.com/wp-content/uploads/2019/06/landshaft-bernskikh-alp-v-yasniy-den_thumb.jpg',
    'https://sebweo.com/wp-content/uploads/2019/06/landshaft-bernskikh-alp-v-yasniy-den_thumb.jpg',
    'https://sebweo.com/wp-content/uploads/2019/06/landshaft-bernskikh-alp-v-yasniy-den_thumb.jpg',
  ];
  return (
    <div className={styles.content}>
      <div>
        {image.map((url) => (
          <img src={url} alt="" />
        ))}
        {/* <img src="https://www.w3schools.com/css/img_5terre.jpg" alt="pelican" /> */}
      </div>
      <div className={styles.text}>
        {props.posts.map((item, index) => (
          <div key={index}>{item}</div>
        ))}
      </div>
      <div>
        {props.alina.map((elem, index) => (
          <div key={index} className={styles.posts}>
            {elem}
          </div>
        ))}
      </div>
    </div>
  );
};

export default Profile;
